import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import Alert from 'react-bootstrap/Alert';
import ItemForm from "./ItemForm";
import './resources/Form.css'

const Energy = ({ setForm, formData, navigation }) => {
  const { no, less, average, tired, bedRiden } = formData;

  const { previous, next } = navigation;

  return (
    <div className="form">
      <h3>Hur är din allmänna ork?</h3>
      <ItemForm label="Som vanligt" name="normal" value={no} onChange={setForm} />
      <ItemForm label="Ja, jag får andnöd vid lätt ansträngning men inte i vila" name="less" value={less} onChange={setForm} />
      <ItemForm label="Är mest sängliggande men kan vara uppe korta stunder" name="average" value={average} onChange={setForm} />
      <ItemForm label="Orkar bara ligga till sängs, men klarar toalettbesök" name="tired" value={tired} onChange={setForm} />
      <ItemForm label="Tar mig inte ur sängen" name="bedRiden" value={bedRiden} onChange={setForm} />
      <div>
        <Button onClick={previous}>Previous</Button>{' '}
        <Button onClick={next}>Next</Button>
      </div>
    </div>
  );
};

export default Energy;
